d (C6H7N3O) used in the treatment of tuberculosis.','en',4,'2015-10-19 11:06:58',NULL,NULL,'4c9db1a7-4797-4829-bafa-13e815a0603c'),(75,1226,'Semisynthetic antibiotic often used in tuberculosis, leprosy and meningococcal treatment/prophylaxis.  Also commonly known as Rifampin.','en',4,'2015-10-19 11:06:58',NULL,NULL,'ff0231db-25a8-49eb-923e-977d838119f5'),(76,221,'Anti-mycobaterial drug used to treat active tuberculosis. Always used with other antimycobacterial agents.','en',4,'2015-10-19 11:06:58',NULL,NULL,'c5142213-8e6a-4179-9872-75dca2276598'),(77,237,'Antituberculosis agent used to treat patients with active tuberculosis, usually in combination with other agents.','en',4,'2015-10-19 11:06:58',NULL,NULL,'d5518289-8764-4f56-bd8b-f1eeb28605c3'),(78,215,'Injectable aminoglycoside used in drug-resistant TB treatment. Inhibits protein synthesis through disruption of ribosomal function. (Short name from WHO)','en',4,'2015-10-19 11:06:58',NULL,NULL,'66a74f7a-a129-4632-8d0b-71bffa0490cd'),(79,227,'Aminoglycoside used in drug-resistant TB treatment. (Short name from WHO)','en',4,'2015-10-19 11:06:58',NULL,NULL,'4b3ef1d7-6aa4-45e3-8e47-871a116cdf93'),(80,236,'Isonicotinic acid derivative used in drug-resistant TB treatment. (Short name Pto from WHO)','en',4,'2015-10-19 11:06:59',NULL,NULL,'da4bb82a-3d5c-4448-82d3-0f081e844cea'),(81,223,'Isonicotinic acid derivative used in drug-resistant TB treatment. (Short name from WHO)','en',4,'2015-10-19 11:06:59',NULL,NULL,'59f005d5-36d2-4863-910a-3ed1126a31c3'),(82,220,'D-Alanine analog used in drug-resistant TB treatment. (Short name from WHO)','en',4,'2015-10-19 11:06:59',NULL,NULL,'3daab8a2-29ec-44f5-9756-cf20326ff5a7'),(83,244,'Terizidone is a combination of two cycloserine molecules. It is an anti-tuberculous drug used in treating multidrug-resistant TB. TERIZIDONE is considered effective in the treatment of TB and may also be useful for the treatment of urinary tract infections including those due to TB. It is recommended for 