on, when the patient starts the new regimen, the previous treatment should be closed and the appropriate outcome should be recorded. \r\n<br>\r\nSituation 2: If an empiric regimen for a duration longer than a month is being changed due to the results of a baseline DST (i.e. the treatment is \"adapted\" to the baseline DST results), the previous treatment should be closed and the outcome should be recorded as \"Treatment adapted\".\r\n<br>\r\nSituation 3: If the regimen is being changed due to adverse events (e.g. replacement of kanamycin with bedaquiline) but the patient is culture negative and does not fulfill the definition of failure, this is not considered a new treatment, but rather a continuation of the original treatment.','en',4,'2016-11-17 02:52:46',NULL,NULL,'7fc1adee-ff0f-4510-9c6d-21272672e3cc'),(356,1246,'ONLY enter documented results (either results from the laboratory or from the patient medical record of copies of these)','en',1,'2016-12-15 00:00:00',NULL,NULL,'17bf2e95-c246-11e6-b63d-aa00f0e9ee47'),(357,2706,'Yes, it is from a laboratory report or an endTB form that was transcribed from a laboratory report.\r\n<br>\r\nNo, it is from a clinical note, consilium letter, treatment card, etc.','en',4,'2017-01-30 23:22:05',4,'2017-02-02 01:34:50','c8c25e97-5d38-4cb4-8a3a-6f37ff2b0cdd'),(358,2706,'Да, эта форма из лабораторного отчета или форма endTB была воспроизведена из лаботраторного отчета\r\n</br>\r\nНет, эта форма из врачебной записи, заключения консилиума, карты лечения, и т.д.','ru',4,'2017-02-14 04:31:33',NULL,NULL,'e3feab11-224e-491d-8c14-376ce4774dad');
