015-12-10 15:08:48',0,NULL,NULL,NULL,'82dc4f82-2010-4c58-b1e0-daa560d172bc'),(36,'Abbreviation','Custom dictionary for storing abbreviation of concepts',NULL,1,'2016-01-04 19:48:20',0,NULL,NULL,NULL,'01b9b390-b2ee-11e5-8c5a-040196a60101'),(37,'EndTB-Export','Codes for output in endTB exports','',1,'2016-07-19 03:22:42',0,NULL,NULL,NULL,'c2f294d5-4d2d-11e6-8843-aa00f0e9ee47');
